import React from 'react'
import MainTitle from "../../components/MainTitle/MainTitle";
import { Swiper, SwiperSlide } from 'swiper/react';
import { Autoplay, Pagination, Navigation } from 'swiper/modules';
import Card from "../../components/Card/Card";
import { CardIcon2, CardIcon3, CardIcon4 } from "../../assets/icons";

import 'swiper/css';
import 'swiper/css/pagination';
import 'swiper/css/navigation';


import "./Prices.scss";

const data = [
    {
        id: 0,
        cityName: "Istanbul",
        users: "234",
        price: "$420",
        items: [
            {
                icon: <CardIcon2 />,
                text: "5 Days Trip > Hotel Included"
            },

            {
                icon: <CardIcon3 />,
                text: "Airplane Bill Included"
            },

            {
                icon: <CardIcon4 />,
                text: "Daily Places Visit"
            },
        ]
    },

    {
        id: 1,
        cityName: "Dubai",
        users: "300",
        price: "$700",
        items: [
            {
                icon: <CardIcon2 />,
                text: "5 Days Trip > Hotel Included"
            },

            {
                icon: <CardIcon3 />,
                text: "Airplane Bill Included"
            },

            {
                icon: <CardIcon4 />,
                text: "Daily Places Visit"
            }
        ]
    },

    {
        id: 2,
        cityName: "Antalya",
        users: "500",
        price: "$999",
        items: [
            {
                icon: <CardIcon2 />,
                text: "5 Days Trip > Hotel Included"
            },

            {
                icon: <CardIcon3 />,
                text: "Airplane Bill Included"
            },

            {
                icon: <CardIcon4 />,
                text: "Daily Places Visit"
            }
        ]
    },
    {
        id: 3,
        cityName: "Sharm El-Sheikh",
        users: "200",
        price: "$999",
        items: [
            {
                icon: <CardIcon2 />,
                text: "5 Days Trip > Hotel Included"
            },

            {
                icon: <CardIcon3 />,
                text: "Airplane Bill Included"
            },

            {
                icon: <CardIcon4 />,
                text: "Daily Places Visit"
            }
        ]
    },

    {
        id: 4,
        cityName: "USA",
        users: "400",
        items: [
            {
                icon: <CardIcon2 />,
                text: "5 Days Trip > Hotel Included"
            },

            {
                icon: <CardIcon3 />,
                text: "Airplane Bill Included"
            },

            {
                icon: <CardIcon4 />,
                text: "Daily Places Visit"
            }
        ]
    },

    {
        id: 5,
        cityName: "England",
        users: "234",
        items: [
            {
                icon: <CardIcon2 />,
                text: "5 Days Trip > Hotel Included"
            },

            {
                icon: <CardIcon3 />,
                text: "Airplane Bill Included"
            },

            {
                icon: <CardIcon4 />,
                text: "Daily Places Visit"
            }
        ]
    },

    {
        id: 6,
        cityName: "Canada",
        users: "345",
        items: [
            {
                icon: <CardIcon2 />,
                text: "5 Days Trip > Hotel Included"
            },

            {
                icon: <CardIcon3 />,
                text: "Airplane Bill Included"
            },

            {
                icon: <CardIcon4 />,
                text: "Daily Places Visit"
            }
        ]
    },

    {
        id: 7,
        cityName: "European Union",
        users: "345",
        items: [
            {
                icon: <CardIcon2 />,
                text: "5 Days Trip > Hotel Included"
            },

            {
                icon: <CardIcon3 />,
                text: "Airplane Bill Included"
            },

            {
                icon: <CardIcon4 />,
                text: "Daily Places Visit"
            }
        ]
    },
];

const Prices = () => {
    return (
        <div className="Prices">
            <MainTitle
                title="Best Weekly Offers In Each City"
                text="Discover the best weekly offers in each city, curated just for you.
                Immerse yourself in a world of savings and indulge in unparalleled experiences."
            />

            {/* <div className="Prices-cards">

            </div> */}

            {/* <Swiper
                slidesPerView={3}
                spaceBetween={100}
                loop={true}
                // navigation={true}
                autoplay={{
                    delay: 1000,
                    pauseOnMouseEnter: false,
                }}
                // pagination={{
                //     clickable: true,
                // }}
                breakpoints={{
                    640: {
                        slidesPerView: 2,
                        spaceBetween: 20,
                    },
                    768: {
                        slidesPerView: 4,
                        spaceBetween: 40,
                    },
                    1024: {
                        slidesPerView: 5,
                        spaceBetween: 50,
                    },
                }}
                // centeredSlides={true}
                modules={[Autoplay, Pagination, Navigation]}
                className="mySwiper"
            > */}
            <Swiper
                slidesPerView={3}
                spaceBetween={100}
                loop={true}
                autoplay={{
                    delay: 800,
                }}
                navigation={true}
                modules={[Autoplay, Pagination, Navigation]}
                className="mySwiper"
            >
                {
                    data.map(el => (
                        <SwiperSlide>
                            <Card
                                key={el.id}
                                icon={el.icon}
                                price={el.price}
                                cityName={el.cityName}
                                users={el.users}
                                items={[...el.items]}
                            />
                        </SwiperSlide>
                    ))
                }
            </Swiper>

        </div>
    )
}

export default Prices;
